import React, { Component, useState } from "react";
import { VictoryLine, VictoryChart, VictoryAxis } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    this.state = {
        data: [
            {x: "Dec 31 2021", y: 177.57},
            {x: "Jan 3 2022", y: 182.01},
            {x: "Jan 4 2022", y: 179.7},
            {x: "Jan 5 2022", y: 174.92},
            {x: "Jan 6 2022", y: 172},
            {x: "Jan 7 2022", y: 172.17},
            {x: "Jan 10 2022", y: 172.19},
            {x: "Jan 11 2022", y: 175.08},
            {x: "Jan 12 2022", y: 175.53},
            {x: "Jan 13 2022", y: 172.19},
            {x: "Jan 14 2022", y: 173.07},
            {x: "Jan 18 2022", y: 169.8},
            {x: "Jan 19 2022", y: 166.23},
            {x: "Jan 20 2022", y: 164.51},
            {x: "Jan 21 2022", y: 162.41},
            {x: "Jan 24 2022", y: 161.62},
            {x: "Jan 25 2022", y: 159.78},
            {x: "Jan 26 2022", y: 159.69},
            {x: "Jan 27 2022", y: 159.22},
            {x: "Jan 28 2022", y: 170.33},
        ]
      };
    // console.log(chart)
    }
    // componentDidMount() {
    //     this.setState({data: compHistory("AAPL", 1)})
    // }
  render() {
      console.log(this.state.data)
    return (
      <div>
        <h1>Apple Stock Prices Past Month</h1>
        <VictoryChart>
          <VictoryLine
            data={this.state.data}
            style={{
              data: {
                stroke: "#02B875"
              }
            }}
          />
          <VictoryAxis />
            {
                ["Dec 31 2021", "Jan 3 2022", "Jan 4 2022", "Jan 5 2022", "Jan 6 2022", 
                "Jan 7 2022","Jan 10 2022","Jan 11 2022","Jan 12 2022","Jan 13 2022",
                "Jan 14 2022","Jan 18 2022","Jan 19 2022","Jan 20 2022","Jan 21 2022",
                "Jan 24 2022","Jan 25 2022","Jan 26 2022","Jan 27 2022","Jan 28 2022"].map((d, i) => {
                return (
                    <VictoryAxis dependentAxis
                    key={i}
                    label={d}
                    style={{ tickLabels: { fill: "none" } }}
                    axisValue={d}
                    />
                );
                })
            }
        </VictoryChart>
      </div>
    );
  }
}
